    //     "height":'200px'
    // }
    
    const backSize={

        "height": '450px',
        "overflow": 'hidden',
        "background-size": 'cover',
        "width": '100%'
    }

    return(
        <>
            <Bar/>
            <img style={backSize} src="../pics/background.png" alt="backgroundimage"/>
            
            {/* <div className="mt-3 container" > */}
                <div className="row justify-content-center">
                    <div className="col-lg-6 col-md-8 col-sm-12 shadow-lg p-3">
                        
                        <TextField 
                            required
                            id="outlined-required"
                            input
                            label="Source"
                         /> 

                        <TextField
                            required
                            id="filled-required"
                            label="Destination"
                        />
                        
                        <input type="date"/>
                        
                        <div className="text-center mb-2">
                        <Button variant="contained" color="success">Search</Button>
                        </div>
                        </div>
                        {/* <Carousel>
                            <Carousel.Item>
                                <img style={sizeStyle}
