                                src="../pics/one.png"
                                alt="First slide"
                                />
                            </Carousel.Item>
                            <Carousel.Item>
                                <img style={sizeStyle}
                                className="d-block w-100"
                                src="../pics/two.jpg"
                                alt="Second slide"
                                />
                            </Carousel.Item>
                            <Carousel.Item>
                                <img style={sizeStyle}
                                className="d-block w-100"
                                src="../pics/three.jpg"
                                alt="Third slide"
                                />
                            </Carousel.Item>
                        </Carousel> */}

                        <div class="card shadow-lg">
                        <div className="d-flex flex-row flex-nowrap overflow-auto p-4">
                            <img src="../pics/one.png" className="me-3" alt="..."/>
                            <img src="../pics/two.jpg"  alt="..."/>
                            <div class="card-body">
                            </div>   
                         </div>   
                        
                    </div> 
                </div>
            {/* </div> */}
        </>
    );
}

export default Home;
